import useStyles from "./MainContentStyles"
import Navbar from '../Navbar/Navbar'
import { Route, Switch } from "react-router";
import Client from "./Client/Client";

const MainContent = () => {

    const classes = useStyles();

    return (
        <div>
           <Navbar />
            <Switch>

                <Route path="/client">
                    <Client />
                </Route>

            </Switch>
        </div>
    )
}

export default MainContent
